script: |
  super -f text -I q3315.spq | sort > q3315.out

inputs:
  - name: q3315.spq
    data: |
      SELECT 84 - - col2 + - 34 AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT ( NULL ) BETWEEN - col1 + + - col0 * - - 92 AND - - col0 * - 45 / - col2 + + col1 + - col1 + - 89;
  - name: tab0

outputs:
  - name: q3315.out
    data: |
